import React from 'react';

function SuccessStories() {
  const stories = [
    { name: 'Rohan', result: 'Software Engineer', quote: 'Margdarshak helped me realize my love for coding!' },
    { name: 'Priya', result: 'Graphic Designer', quote: 'I never knew my doodles could be a career.' },
    { name: 'Amit', result: 'Data Scientist', quote: 'The aptitude test was spot on.' }
  ];

  return (
    <div className="section" style={{ background: '#f8f9fa' }}>
      <h2 className="text-center mb-2">Success Stories</h2>
      <div className="grid">
        {stories.map((story, index) => (
          <div key={index} className="card">
            <p style={{ fontStyle: 'italic', marginBottom: '1rem' }}>"{story.quote}"</p>
            <h4>{story.name}</h4>
            <p style={{ color: 'var(--primary)', fontWeight: 'bold' }}>Now a {story.result}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default SuccessStories;
